import React from "react";
import { NavLink } from "react-router-dom";

class ContactPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      email: "",
      message: "",
      disabled: false,
      emailSent: null,
    };
  }

  render() {
    return <p>ContactPage Works!</p>;
  }
}

export default ContactPage;
